function PriorityQueue(){function i(i,t){this.element=i,this.priority=t}var t=[];this.enqueue=function(e,n){var r=new i(e,n);if(0===t.length)t.push(r);else{for(var u=!1,h=0;h<t.length;h++)if(r.priority<t[h].priority){t.splice(h,0,r),u=!0;break}u||t.push(r)}},this.dequeue=function(){return t.shift()},this.front=function(){return t[0]},this.size=function(){return t.length}}